description:
बैंक तथा वित्तीय संस्था परिसंघ, नेपाल (सिबिफिन)ले नयाँ नेतृत्व पाएको छ ।

सिबिफिनको अध्यक्षमा हिमालयन बैंकका अध्यक्ष प्रचण्डबहादुर श्रेष्ठ सर्वसम्मत चयन भएका हुन् ।​&amp;nbsp;

परिसंघका कार्यवाहक अध्यक्ष राजेश उपाध्यायको&amp;nbsp;अध्यक्षतामा मङ्गलबार

अमेरिकाले फेरि ८० जना नेपाली नागरिकलाई डिपोर्ट गरेको छ ।&amp;nbsp;

मंगलबार चार्टर्ड विमानमार्फत ८० जना नेपालीलाई अमेरिकाले काठमाडौं ल्याएर छाडिदिएको अध्यागमन विभागले जनाएको छ ।&amp;nbsp;

विभागका प्रवक्ता टीकाराम ढकालका अनुसार डिपोर्ट हुनेमा ७९ जना

विशेष अदालतले पतञ्जली योगपीठ जग्गा प्रकरणमा दायर भ्रष्टाचार मुद्दामा मिसिल झिकाउने आदेश गरेको छ ।&amp;nbsp;

पूर्वप्रधानमन्त्री माधवकुमार नेपालसमेत प्रतिवादी रहेको मुद्दामा बुधबार विशेष अदालतले मिसिल झिकाउने आदेश गरेको हो ।&amp;nbsp;

